#### We use an own table for connection between qwb words and section of the sign stream which allow a n::m relation
create table sign_stream_section_to_qwb_word
(
	sign_stream_section_id int unsigned not null comment 'Refers to sign_stream_section',
	qwb_word_id int unsigned not null comment 'Refers to qwb_word',
	constraint sign_stream_section_to_qwb_word_pk
		unique (sign_stream_section_id, qwb_word_id),
	constraint sss_to_qwb_word_fk
		foreign key (qwb_word_id) references qwb_word (qwb_word_id),
	constraint sss_to_qwb_word_to_sss_fk
		foreign key (sign_stream_section_id) references sign_stream_section (sign_stream_section_id)
) comment 'Provides n:m connection between qwb words and sections of the sign stream.';

