##### Glyph tables

drop table external_font_glyph;

create table scribal_font_glyph_metrics
(
    scribal_font_glyph_metrics_id int unsigned         not null
        primary key comment 'Unique identifier',
    scribal_font_id               int unsigned         not null comment 'Reference to scribal font',
    unicode_char                  varbinary(4)         not null comment 'Char of font',
    width                         smallint(6) unsigned not null default 100 comment 'Width of glyph' ,
    height                        smallint unsigned    not null default 200 comment 'Height of glyph',
    y_offset                      smallint    not null default -200 comment 'Vertical offset glyph (thought to stand on line)',
    constraint char_idx
        unique (unicode_char),
   constraint fk_sfg_to_scribal_font
		foreign key (scribal_font_id) references scribal_font (scribal_font_id)
)
    collate = utf8mb4_unicode_ci comment 'Contains the bounding box and position metrics of a scribal font. Only used to calculate ROIs not yet set by the user.';

#### Add an owner table

create table scribal_font_glyph_metrics_owner
(
    scribal_font_glyph_metrics_id      int(11) unsigned default 0 not null,
    edition_editor_id int unsigned     default 0 not null,
    edition_id        int unsigned     default 0 not null,
    primary key (scribal_font_glyph_metrics_id, edition_id),
    constraint fk_sfgm_owner_to_sfgm
        foreign key (scribal_font_glyph_metrics_id) references scribal_font_glyph_metrics (scribal_font_glyph_metrics_id),
    constraint fk_sfgm_to_edition
        foreign key (edition_id) references edition (edition_id),
    constraint fk_sfgm_to_edition_editor
        foreign key (edition_editor_id) references edition_editor (edition_editor_id)
)
    collate = utf8mb4_unicode_ci;

##### Kerning

drop table kerning_of_char;

create table scribal_font_kerning
(
    scribal_font_kerning_id int unsigned         not null
        primary key comment 'Unique identifier',
    scribal_font_id               int unsigned         not null comment 'Reference to scribal font',
    first_unicode_char                  varbinary(4)         not null comment 'Charcode of the first glyph',
    second_unicode_char                  varbinary(4)         not null comment 'Charcode of the second glyph',
    kerning_x                         smallint not null default 0 comment 'Horizontal kerning' ,
    kerning_y                        smallint     not null default 0 comment 'Vertical kerning',
    constraint char_idx
        unique (scribal_font_id, first_unicode_char, second_unicode_char),
   constraint fk_sfk_to_scribal_font
		foreign key (scribal_font_id) references scribal_font (scribal_font_id)
)
    collate = utf8mb4_unicode_ci comment 'Contains kerning of glyph of a scribal font. Only used to calculated the position of signs not yet positioned by the user';
#### Add an owner table

create table scribal_font_kerning_owner
(
    scribal_font_kerning_id      int(11) unsigned default 0 not null,
    edition_editor_id int unsigned     default 0 not null,
    edition_id        int unsigned     default 0 not null,
    primary key (scribal_font_kerning_id, edition_id),
    constraint fk_sfk_owner_to_sfk
        foreign key (scribal_font_kerning_id) references scribal_font_kerning (scribal_font_kerning_id),
    constraint fk_sfk_to_edition
        foreign key (edition_id) references edition (edition_id),
    constraint fk_sfk_to_edition_editor
        foreign key (edition_editor_id) references edition_editor (edition_editor_id)
)
    collate = utf8mb4_unicode_ci;

alter table manuscript_metrics
	add scribal_font_id int unsigned  null;

alter table manuscript_metrics
	add constraint manuscript_metrics_to_scribal_font_fk
		foreign key (scribal_font_id) references scribal_font (scribal_font_id);

